import Form from "./components/form1";

const Signin = () => {
  return (
    <div className="register-page">
      <div>
        <h1 className="title">
          Welcome to Money Expensive!
          <br></br> <span>Please Register Here</span>
        </h1>
        <div class="title_underline"></div>
      </div>
      <div>
        <Form />
      </div>
      <div>
        <Title2 />
      </div>
    </div>
  );
};

export default Signin;
